const SubjectItemList = ({subjects}) => {
    return (
        <div>
            <ul>
                {
                    subjects.map((subject) => {
                        return (
                            <li key={subject.id}>{subject.name}</li>
                        )
                    })
                }
            </ul>
        </div>
    )
}

export default SubjectItemList;
